import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonInput, IonImg, IonList, IonItem, IonThumbnail, IonLabel } from '@ionic/react';
import React from 'react';



/*Test Code */
// import React from 'react';
// import { IonList, IonItem, IonThumbnail, IonImg, IonLabel, IonContent } from '@ionic/react';

type myImage = {
  src: string
}
const myImages: myImage[] = [{ src: 'http://placekitten.com/g/200/300' }];

const catImage = 'http://placekitten.com/g/200/300';


type Item = {
  src: string;
  text: string;
};
const items: Item[] = [{ src: 'http://placekitten.com/g/200/300', text: 'a picture of a cat' }];

export const ImgExample: React.FC = () => (
  <IonContent>
    <IonList>
      {items.map((image, i) => (
        <IonItem key={i}>
          <IonThumbnail slot="start">
            <IonImg src={image.src} />
          </IonThumbnail>
          <IonLabel>{image.text}</IonLabel>
        </IonItem>
      ))}
    </IonList>
  </IonContent>
);
/*Test Code */


const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Logo Goes here...</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent className="ion-padding">
        Derp.
        <header>
            {/* <img src="images/Logo_screenDPI-01.png" alt="Gym warrior Logo" className="center" /> */}
            <IonImg src={catImage} />
        </header>

        <main>
            <section>
                <form>
                    <div className="container">
                        <IonInput type="text" placeholder="Enter Username" name="uname" required />
                    </div>
                    <div className="container">
                        <IonInput type="password" placeholder="Enter Password" name="psw" required />
                    </div>
                    <div className="container">
                        <button type="submit">Login</button>

                    </div>
                </form>
            </section>
        </main>
      </IonContent>
    </IonPage>
  );
};

export default Home;
